import React from 'react'

function footer() {
  return (
    <footer>
      <h2>Caroline-A-Contracting</h2>
      <p>Whether it is building a waterfall locally or disaster relief projects in Alabama, Caroline-A-Contracting has a team of professionals with the skills and tools needed to execute your project.
	    </p>
    </footer>
  )
}

export default footer
